    public static Coin getCoin(String id) {
        Gson gson = new Gson();
        CoinLoreResponse response = gson.fromJson(CoinLoreResponse.json, CoinLoreResponse.class);
        for(Coin coin : (ArrayList<Coin>) response.getData()) {
            if(coin.getSymbol().equals(id)) {
                return coin;
            }
        }
        return null;
    }
